import React, { useEffect, useState } from 'react';

const Home=()=>{

    const [news,setNews]=useState('');

    const callHome=async()=>{

        await fetch('/home')
        .then(res=>res.json())
        .then(data=>{
            console.log(data);
            setNews(data)})
        .catch(err=>console.log(err))
    }

    useEffect(()=>{
        callHome();
    },[]);

    return(
        <h1>{news.heading}</h1>
    );

}

export default Home;
